INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (0, 6, 103311, 11, 1, 1033501046, "それにしても食べるのが\nもったいねぇいいケーキだなぁ……\nでも食べなきゃ食べねぇで\nもったいねぇよなぁ……", 1033501, 0, 1, "");
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES ("", "", 0, 91, "", 1033501047, "", 1033501, "", "", "");
