INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (0, 6, 103311, 11, 1, 1033501049, "うーん……\nオラ一人で食べるのも申し訳ねぇし\nエリザベスパークのみんなで\n食べるべか！", 1033501, 0, 1, "");
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES ("", "", 0, 91, "", 1033501050, "", 1033501, "", "", "");
