INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (0, 5, 105211, 11, 1, 1052501049, "私、もう十分に喜んでるわ！\nでも、あなたのそんな言葉を聞いたら\nもう少しわがままを\n言いたくなっちゃうわ。", 1052501, 0, 1, "");
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES ("", "", 0, 91, "", 1052501050, "", 1052501, "", "", "");
